import React from 'react';

const PopulateField = props => {
  const { state, postive, hospitalized, death } = props.feilds;
  console.log(props.feilds);
  return (
    <div>
      <h1>{state} </h1>
      <h2>{postive} </h2>
      <h2>{hospitalized}</h2>
      <h2>{death} </h2>
    </div>
  );
};

export default PopulateField;
